import React from "react";
import Row from "./Row";
import requests from "./requests";
const App=()=> {
  return (
   <>
   <h1>NETFLIX</h1>
   <Row title="NETFLIX ORIGINALS" fetchUrl={requests.fetchNetflixOriginals} />
   <Row title="Trending Now"/>
   </>
  );
}

export default App;
